import React, { useEffect } from 'react';
import Map from './Map';


export default function Homepage({ controllerVal }) {
	useEffect(() => {
		toast('Select a place by clicking one of the icons on the Map');
	}, []);
	return (
		<div>
			<Map controllerVal={controllerVal} />
		</div>
	);
}
